import React from 'react';
import Logo from ".././img/Home Link_logo.jpg";

class Button extends React.Component{
  render() {
    return(
     <div className='button'>
       <img src={Logo} alt="Logo" />
       <button type="submit"/>
       <button type="submit"/>
     </div>
    );
  }
}

export default Button;
